import React, {useState} from 'react';

const Child3 = ({change}) => {

const handlerChangeInput = (e) => {
    change(e.target.value)
}

    return (
        <div>
            <h2>Child component</h2>

            <form>
                <input type={'text'}
                       placeholder={'write here something....'}
                       onChange={handlerChangeInput}
                />
            </form>
        </div>
    );
}

export default Child3;
